import React from 'react';
import { useHistory } from 'react-router-dom';
import '../assets/css/welcome-page.css'; // CSS file for styling

const WelcomePage = () => {
  return (
    <div className="welcome-container">
      <div className="welcome-content">
        <h1 className="welcome-title">Welcome</h1>
        <div className="button-container">
          
          <button className="login-button" onClick={to="/login"}>Wanna Login Here?</button>
          <button className="signup-button" onClick={"/register"}>Don't have an account?</button>
        
        </div>
      </div>
    </div>
  );
}

export default WelcomePage;
